import React from 'react';
import ReactDOM from 'react-dom/client'; // Import dari react-dom/client untuk React 18+
import './index.css'; // Import global CSS Anda
import App from './App';
import { BrowserRouter } from 'react-router-dom'; // Import BrowserRouter

// Gunakan createRoot untuk React 18
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    {/* Bungkus komponen App di dalam BrowserRouter */}
    {/* Ini memastikan seluruh aplikasi berada dalam konteks router */}
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>
);
